	var margin = {top: 20, right: 20, bottom: 30, left: 70},
		width = 960 - margin.left - margin.right,
		height = 500 - margin.top - margin.bottom;

	var x = d3.scale.linear()
			.range([0, width]);

	var y = d3.scale.linear()
			.range([height, 0]);
		
	var bisectDate = d3.bisector(function(d) {
			return d[0];
	}).left;
		
	function mousemove() {
		var x0 = x.invert(d3.mouse(this)[0]),
				i = bisectDate(data.content, x0, 1),
				d0 = data.content[i - 1],
				d1 = data.content[i],
				d = x0 - d0[0] > d1[0] - x0 ? d1 : d0;
		focus.attr("transform", "translate(" + x(d[0]) + "," + y(d[1]) + ")");
		focus.select("text").text(d[1].toFixed(4) + ',   ' + d[0]);
	}
	
	function zoomed() {
		svg.select(".x.axis").call(xAxis);
		svg.select(".y.axis").call(yAxis);   
		
		//To zoom Line
		svg.selectAll('path.line').attr('d', line);
		//To Set zoom on points on the line.
		points.selectAll('circle').attr("transform", function(d) { 
			return "translate(" + x(d[0]) + "," + y(d[1]) + ")"; }
		); 
	}

	// Used D3.max() because data is not correct for max min values
	y.domain([data.minPower, d3.max(data.content, function(d) { return d[1]; })]);
	x.domain([data.minFrequency, d3.max(data.content, function(d) { return d[0]; })]);

	var xAxis = d3.svg.axis()
			.scale(x)
			.tickSize(-height)
			.tickPadding(10)	
